import './App.css';
import { useState, useEffect } from 'react';

function App() {
  const[head,setHead] = useState('');

  const change = ()=>{
    setHead(true);
  }
  return (
    <div>
      <h1>React</h1>

      <button onClick="change"></button>
    </div>
  )
}    
export default App;
